import React from 'react';
import google from 'styled-components';
import googleIcon from '../img/icon-google.png';

interface LoginGButtonProps {
  label: string;
}

const GoogleButton = google.button`
  background-color: #fff;
  color: #555;
  padding: 10px 20px;
  border: 0.2px solid #333;
  cursor: pointer;
  font-size: 16px;
  align-items: center;
  width: 85%;
  border-radius: 5px;
  line-height: 1.2px;
  margin-top: 15px;

  font-family: open sans;

  height: 54px;
    padding-left: 30px;
    padding-right: 30px;

  transition: background-color 1s linear;

  box-shadow: 0 1px 5px 0 rgba(0,0,0,.2);

`;

const LoginGButton: React.FC<LoginGButtonProps> = ({ label }) => {
  return (
    <GoogleButton type="submit">
      <img src={googleIcon} alt="Google Icon" /> {label}
    </GoogleButton>
  );
};

export default LoginGButton;
